import React from 'react';


function Header(props) {
    return (
        <div className="nav-header">
        <div className="container">
            <ul className="nav">
                <li><a href="#">Bình!</a></li>
                <li><a href="#">Sign Out</a></li>
            </ul>
        </div>
    </div>
    );
}

export default Header;
